import Header from './header';
import Footer from './footer';
import styles from '../screens/CSS/home.module.css';
import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import { Tabs, AppBar } from '@mui/material';
import { Typography } from '@mui/material';
import ProductInformation from './product';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
import stylesProduct from '../screens/CSS/productInfor.module.css';
import imageTest from '../assets/testproduct.jpg'
import { Rating } from '@mui/material';
import { Link } from 'react-router-dom';
import ButtonChangeValue from './buttonChangeValue';
import UserRating from './userRating';
import OrderUserItem from './OrderUserItem';

function TabPanel(props) {
    const { children, value, index, productOrders, ...other } = props;

    const orderId = [
      {id: 1, status:"Cho xac nhan"},
      {id: 2, status:"Cho lay hang"},
      {id: 3, status:"Dang giao"},
      {id: 4, status:"Da giao"},
      {id: 5, status:"Da huy"}
    ]

    return (
      <div>
        {value === index && (
          <div>
          {productOrders.map((productOrder) => {
            return(
              <OrderUserItem 
                productOrder={productOrder}
              />
            )
          })}
          </div>
        )}
      </div>
    );
  }

function OrderUserManager({navigation}){
  
  const orders = [
    {status: "Cho lay hang", name: "Bộ Sưu Tập Khối Rubik Carbon MoYu Meilong 2x2 3x3 4x4 5x5 Tam Giác 12 Mặt Skewb Square-1 SQ-1 Megaminx Pyranminx Cube", type: "Do choi", count: 3, cost: 30000},
    {status: "Cho lay hang", name: "Mô Hình Nendoroid Nino Nakano - Nendoroid 1612 Gotoubun No Hanayome", type: "Mo hinh", count: 1, cost: 300000},
    {status: "Da giao", name: "Mô Hình Nendoroid Nino Nakano - Nendoroid 1612 Gotoubun No Hanayome", type: "Mo hinh", count: 1, cost: 300000},
    {status: "Da huy", name: "Mô Hình Nendoroid Nino Nakano - Nendoroid 1612 Gotoubun No Hanayome", type: "Mo hinh", count: 1, cost: 300000},
    {status: "Cho xac nhan", name: "Mô Hình Nendoroid Nino Nakano - Nendoroid 1612 Gotoubun No Hanayome", type: "Mo hinh", count: 1, cost: 300000},
  ];
  
  const [value, setValue] = React.useState(1);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return(
        <div className={styles.Home}>
            <Header navigation={navigation}/>
            <div className={styles.content} >
                <div className={styles.wraper}>
                    <p className={styles.tdisplay}> Quan ly don hang </p>
                    <Box
                    sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex' }}
                    >
                        <Tabs
                        value={value}
                        onChange={handleChange}
                        textColor="secondary"
                        indicatorColor="secondary"
                        aria-label="secondary tabs example"
                        orientation="vertical"
                        >
                            <Tab value={0} label="Tat ca"/>
                            <Tab value={1} label="Cho xac nhan" />
                            <Tab value={2} label="Cho lay hang"/>
                            <Tab value={3} label="Dang giao"/>
                            <Tab value={4} label="Da giao"/>
                            <Tab value={5} label="Da huy"/>
                        </Tabs>
                        <TabPanel value={value} index={0} productOrders={orders}>        
                        </TabPanel>
                        <TabPanel value={value} index={1} productOrders={orders}>
                        </TabPanel>
                        <TabPanel value={value} index={2} productOrders={orders}>
                        </TabPanel>
                        <TabPanel value={value} index={3} productOrders={orders}>
                        </TabPanel>
                        <TabPanel value={value} index={4} productOrders={orders}>
                        </TabPanel>
                        <TabPanel value={value} index={5} productOrders={orders}>
                        </TabPanel>
                </Box> 
                </div>
            </div>
            <Footer navigation={navigation}/>
      </div>
    );
}

export default OrderUserManager;
